import React, { useState } from "react";
import { useNavigate, Link, Routes, Route } from "react-router-dom";
import GroupData from "./Group";
import GroupForm from "../components/groupExpense";

const ShowData = () => {
    // const navigate = useNavigate();
    const data = {
        groupName: "subway",
        paidByName: "you",
        amount: "1000",
        members: [
            { name: "You", amount: "200.00" },
            { name: "Om", amount: "200.00" },
            { name: "Sapna", amount: "200.00" },
            { name: "Shruti", amount: "200.00" },
            { name: "Shivani", amount: "200.00" },
        ],
    };

    return (
        <div>
            <GroupData {...data} />
            <Link to="/AddExpense">Add Expense</Link>

            <Routes>
                <Route
                    path="/AddExpense"
                    element={<GroupForm members={data.members} />}
                />
            </Routes>
        </div>
    );
};

export default ShowData;
